// Styled Components
import { HashtagCloud } from "../../styled/posts/hashtagCloud";

export default function HashtagCloudComponent() {
    return (
        <HashtagCloud>
        <p>#hashtag</p>
        <p>#hashtag</p>
        <p>#hashtag</p>
        </HashtagCloud>
    );
    }
